    if (error) throw error;
    console.log('User info is: ', rows);
    res.send(rows);
  });
});



var server = app.listen(3001, function () {
  var host = server.address().address;
  var port = server.address().port;

  console.log('Server is working : PORT - ',port);
});

module.exports = app;

